%   
% engine internal efficiency
eta  = [     0.05     0.08194            0.155155             0.221603            0.279542              0.325395           0.351588           0.364541                0.366007         0.369848             0.378109          0.379244             0.379887                0.378984        0.366088           0.344506              0.301627           0.273756            0.254624               0.243391              0.237277];
% maximum engine 
Tmax = 153.012*ones(1,length(Te0_list));
% Engine efficiency (function of speed)
e_th = interp1(we_list,eta,wg,'linear','extrap');
% Fuel mass flow (function of power and efficiency)
m_dot_fuel = Te.*wg./e_th./gasoline_lower_heating_value;
%CASE 2_ONLY ICE
m_dot_fuel2 = Te2.*wg./e_th./gasoline_lower_heating_value;

% Maximum engine torque
Te_max = interp1(we_list,Tmax,wg,'linear','extrap');
% Fuel power consumption
Pe = m_dot_fuel .* gasoline_lower_heating_value;

%CASE 2_ONLY ICE
Pe2 = m_dot_fuel2 .* gasoline_lower_heating_value;
% Calculate infeasible
ine = (Te > Te_max);


